query ZarazAnalyticsEventUsersReport(
  $zoneTag: string
  $limit: uint64!
  $filter: ZoneZarazAnalyticsTrackAdaptiveGroupsFilter_InputObject!
  $orderBy: [ZoneZarazAnalyticsTrackAdaptiveGroupsOrderBy!]
) {
  viewer {
    zones(filter: { zoneTag: $zoneTag }) {
      data: zarazAnalyticsTrackAdaptiveGroups(
        limit: $limit
        filter: { AND: $filter }
        orderBy: [$orderBy]
      ) @connection(key: ZarazAnalyticsEventUsersData) {
        count
        dimensions {
          clientId
        }
      }
    }
  }
}

